                />
              </div>
              <div className="fs-14 header-dark-color mr-10">
                <div style={{ paddingBottom: "5px", color: "white" }}>
                  To
                </div>
                <Dropdown
                  items={temp}
                  label="To"
                  displayKey="name"
                  selectedItem={null}
                  onSelect={this.selectBranchId}
                  className="mb-0 wt-250 ht-30"
                  searchEnabled={true}
                />
              </div>
              <div className="fs-14 header-dark-color mr-10">
                <div style={{ paddingBottom: "5px", color: "white" }}>
                  Origin Yard
                </div>
                <Dropdown
                  items={temp}
                  label="Origin Yard"
                  displayKey="name"
                  selectedItem={null}
                  onSelect={this.selectBranchId}
                  className="mb-0 wt-250 ht-30"
                  searchEnabled={true}
                />
              </div>
              <div>
                {this.state.destinationYardFull.map((ele, idx) => (
                  <div key={idx} style={{ display: "flex", paddingBottom: "15px" }}>
                    <div className="fs-14 header-dark-color mr-10" >
                      <div style={{ paddingBottom: "5px", color: "white" }} key={idx}>
                        {ele.destinationYard}
                      </div>
                      <Dropdown
                        items={temp}
                        label="Destination Yard"
                        displayKey="name"
                        selectedItem={null}
                        onSelect={this.selectBranchId}
                        className="mb-0 wt-250 ht-30"
                        searchEnabled={true}
                      />
                    </div>
                    <div>
                      {idx ?
                        <div className="fs-14 header-dark-color mr-10 cursor-pointer">
                          <br></br>
                          <br></br>
                          <AiOutlineCloseCircle style={{ width: "25px", height: "25px", color: "white" }} onClick={() => this.removeDestionationYard(idx)} />
                        </div>
